      "content": " 新年快乐！🎉 \n 2020年就要过去了，冰凌这一年虽然也没干什么  净咕咕咕了  ，不过还是有点收获的辣 ... \n 小小总结 🚩 \n 今年的冰凌也认识了许多新的朋友，学到了许多新的知识 \n \n 可是由于各种的原因，这里不会全部列出，以后会慢慢补档的哦 \n 新的朋友 👨‍👦‍👦 \n 这里是冰凌在 2020 认识的新朋友们辣~ \n 来自  Lollipop Studio  的小伙伴们 \n \n 首先是  富婆  凉宫长栎  Konara \n 然后是小可爱光标  Cursor_233 \n 接着是豆焰  BeanFlame \n 最后是白夜  Wzhrdx \n 来自  LittleSkin  的朋友们 \n \n 光标是我在  LittleSkin  认识的最好的朋友辣  Cursor_233 \n 然后是无所不能的  金姐姐   小金 \n 来自  Minecraft  的  Modding  和  魔改  圈子的朋友们 \n \n 妖月月！  yaoyaodream \n 酸酸！ 石炭酸不是碳酸 \n 新的知识 \n 在 2020 年里，冰凌不仅交到了许多新朋友，也学到了许多新知识 \n \n Vue \n Vuepress \n Forge \n Fabric \n A lot more... \n TODO \n 这里是冰凌今年的 TODO 辣，不过是否完成都在这了呢 \n \n \n 这里是已经完成或正在做的项目哦 \n \n \n Lollipop Studio \n Sigma \n Lambda \n GKK \n \n \n \n 这里是还未开始做 咕咕咕 的项目哦 \n \n \n QQbot \n \n \n \n 这里是计划中的项目哦， 如果有建议可以在下方的  评论区  提出来哦 \n \n \n TODO... \n \n",
